import React from 'react'
import { Navbar } from 'react-bootstrap'

export default function Header(props) {
    return (

        <div>
            <Navbar style={{background:"#1a161f"}} expand="lg">
                <Navbar.Brand style = {headerStyle}>Facite</Navbar.Brand>
            </Navbar>
        </div>
    )
}

const headerStyle = {
    color: 'blue',
    textAlign: 'center'
}
